package min_window

import "testing"

func TestMinWindow(test *testing.T) {
    var s, t, hope, ret string

    s = "ADOBECODEBANC"
    t = "ABC"
    hope = "BANC"
    ret = minWindow(s, t)
    test.Logf("\ns=%s t=%s \nhope=%s \n ret=%s", s, t, hope, ret)

    s = "aa"
    t = "a"
    hope = "a"
    ret = minWindow(s, t)
    test.Logf("\ns=%s t=%s \nhope=%s \n ret=%s", s, t, hope, ret)

    s = "a"
    t = "aa"
    hope = ""
    ret = minWindow(s, t)
    test.Logf("\ns=%s t=%s \nhope=%s \n ret=%s", s, t, hope, ret)

    s = "bcd"
    t = "aa"
    hope = ""
    ret = minWindow(s, t)
    test.Logf("\ns=%s t=%s \nhope=%s \n ret=%s", s, t, hope, ret)

    s = "ask_not_what_your_country_can_do_for_you_ask_what_you_can_do_for_your_country"
    t = "ask_country"
    hope = ""
    ret = minWindow(s, t)
    test.Logf("\ns=%s t=%s \nhope=%s \n ret=%s", s, t, hope, ret)

    s = ""
    t = ""
    hope = ""
    ret = minWindow(s, t)
    test.Logf("\ns=%s t=%s \nhope=%s \n ret=%s", s, t, hope, ret)
}